    //Mostrar perfiles de un usuario y acceder
    @Path("acceder")
    @POST
    @Produces(MediaType.TEXT_PLAIN)
    public int acceder(@QueryParam("usuario")String usu, @QueryParam("contrasenia")String con) {
        Usuario user = new Usuario(0,usu,con);
        int num = 0;
        try {
            
            ManejadorDB manager = new ManejadorDB();
            num = manager.numPerfiles(user);
            
        } catch (Exception e) {
            System.out.println("Mensaje Error : Error al acceder");
            System.out.println("Mensaje Error : "+e);
        }
        
        return num;
    }
    
    //Optener un datos de usuario
    @Path("usuario")
    @GET
    @Produces(MediaType.APPLICATION_JSON)
    public JsonObject usuario(@QueryParam("usr")String usuario){
        JsonObjectBuilder jsonObject = Json.createObjectBuilder();
        Usuario user = new Usuario(0,usuario,"");
        try {
            ManejadorDB manager = new ManejadorDB();
            user = manager.buscarUsuario(user);
            jsonObject.add("id",user.getId());
            jsonObject.add("usuario",user.getNombre());
            jsonObject.add("Contrasenia",user.getContrasenia());            
        } catch (Exception e) {
            System.out.println("Mensaje Error : Error en la lista de usuarios");
            System.out.println("Mensaje Error : "+e);
        }
        return jsonObject.build();
    }
    
    //Lista de Usuarios
    @Path("usuarios")
    @GET
    @Produces(MediaType.APPLICATION_JSON)
    public JsonArray usuarios(){
        JsonArrayBuilder lista = Json.createArrayBuilder();
        
        try {
            
            ManejadorDB manager = new ManejadorDB();
            ArrayList<Usuario> listaUsuarios = manager.listaUsuarios();
            for(Usuario usr:listaUsuarios){
                JsonObjectBuilder jsonUsr = Json.createObjectBuilder();
                jsonUsr.add("id",usr.getId());
                jsonUsr.add("usuario",usr.getNombre());
                jsonUsr.add("contrasenia",usr.getContrasenia());
                lista.add(jsonUsr);
            }
        
        } catch (Exception e) {
            System.out.println("Mensaje Error : Error en la lista de usuarios");
            System.out.println("Mensaje Error : "+e);
        }
        
        return lista.build();
    }
    
    //Ingresar un Usuario
    @Path("ingresarUsuario")
    @PUT
    @Produces(MediaType.TEXT_PLAIN)
    public boolean nuevoUsuario(@FormParam("nuevo")String cadenaJson) {
        try {
            StringReader sr = new StringReader(cadenaJson);
            JsonReader reader = Json.createReader(sr);
            JsonObject json = reader.readObject();
            
            ManejadorDB manager = new ManejadorDB();
            Usuario user = new Usuario(0,json.getString("usuario"),json.getString("contrasenia"));
            
            manager.ingresarUsuario(user);
            user = manager.buscarUsuario(user);
            manager.ingresarPerfil(user,user.getId(),1);
            
        } catch (Exception e) {
            System.out.println("Mensaje Error : Error al ingresar un usuario");
            System.out.println("Mensaje Error : "+e);
            return false;
        }
        
        return true;
    }
    
    //Ingresar Datos de usuario
    @Path("ingresarDatosUsuario")
    @PUT
    @Produces(MediaType.TEXT_PLAIN)
    public boolean nuevoDatosUsuario(@FormParam("usuario")String cadenaUsuario,@FormParam("datos")String cadenaDatos) {
        try {
            StringReader sr1 = new StringReader(cadenaUsuario);
            JsonReader reader1 = Json.createReader(sr1);
            JsonObject jsonUsuario = reader1.readObject();
            
            StringReader sr2 = new StringReader(cadenaDatos);
            JsonReader reader2 = Json.createReader(sr2);
            JsonObject jsonDatos = reader2.readObject();
            
            Usuario user = new Usuario(jsonUsuario.getInt("id"),jsonUsuario.getString("usuario"),jsonUsuario.getString("Contrasenia"));
            byte[] byteFoto = Base64.getDecoder().decode(jsonDatos.getString("imagen"));
            DatosUsuario datos = new DatosUsuario(user,jsonDatos.getString("nombre"),jsonDatos.getString("datos"),byteFoto);
            
            ManejadorDB manager = new ManejadorDB();
            manager.ingresarDatosUsuario(datos);
        } catch (Exception e) {
            System.out.println("Mensaje Error : Error al ingresar un usuario");
            System.out.println("Mensaje Error : "+e);
            return false;
        }
        return true;
    }
    
