    //Obtener los datos de los perfiles de un usario
    @Path("perfilesUsuario")
    @POST
    @Produces(MediaType.APPLICATION_JSON)
    public JsonArray perfilesUsuario(@QueryParam("id")int id){
        JsonArrayBuilder lista = Json.createArrayBuilder();
        
        try {
            ManejadorDB manager = new ManejadorDB();
            ArrayList<DatosUsuario> datos = manager.listaPerfiles(id);
            
            for(DatosUsuario dato : datos){
                JsonObjectBuilder jsonDatos = Json.createObjectBuilder();
                jsonDatos.add("usuario_id",dato.getUsuario().getId());
                jsonDatos.add("nombre",dato.getNombre());
                jsonDatos.add("datos",dato.getDatos());
                
                String cadenaImagen = "";
                if(dato.getImagen() != null) {
                    byte[] encoded = Base64.getEncoder().encode(dato.getImagen());
                    cadenaImagen = new String(encoded);
                }
                System.out.println("Mensaje Cadena Imagen: "+cadenaImagen);
                jsonDatos.add("imagen",cadenaImagen);
                
                lista.add(jsonDatos);
            }
            
        } catch (Exception e) {
            System.out.println("Mensaje Error : Al acceder a los perfiles");
            System.out.println("Mensaje : "+e);
        }
        
        return lista.build();
    }
    
