    @Path("actualizarDatosUsuario")
    @PUT
    @Produces(MediaType.TEXT_PLAIN)
    public boolean actualizarDatosUsuario(@FormParam("datos")String cadenaDatos) {
        try {
            StringReader sr = new StringReader(cadenaDatos);
            JsonReader reader = Json.createReader(sr);
            JsonObject jsonDatos = reader.readObject();
            
            Usuario user = new Usuario(jsonDatos.getInt("usuario_id"),"","");
            byte[] byteFoto = Base64.getDecoder().decode(jsonDatos.getString("imagen"));
            DatosUsuario datos = new DatosUsuario(user,jsonDatos.getString("nombre"),jsonDatos.getString("datos"),byteFoto);
            
            ManejadorDB manager = new ManejadorDB();
            return manager.actualizarDatos(datos);
        } catch (Exception e) {
            System.out.println("Mensaje Error : Error al actualizar Datos");
            System.out.println("Mensaje Error : "+e);
            return false;
        }
    }
    
