    @Path("favoritas/{id}")
    @GET
    @Produces(MediaType.APPLICATION_JSON)
    @Consumes(MediaType.TEXT_PLAIN)
    public JsonArray pelisFavoritas(@PathParam("id")int id){
        JsonArrayBuilder lista = Json.createArrayBuilder();
        try {
            ManejadorDB manager = new ManejadorDB();
            ArrayList<Pelicula> favoritas = manager.peliculasFavoritas(id);
            
            for (Pelicula peli :  favoritas) {
                JsonObjectBuilder jsonPeli = Json.createObjectBuilder();
                jsonPeli.add("id",peli.getId());
                jsonPeli.add("titulo",peli.getTitulo());
                jsonPeli.add("descripcion",peli.getDescripcion());
                jsonPeli.add("genero",peli.getGenero());
                jsonPeli.add("ruta",peli.getRuta());
                
                String cadenaIcono = "";
                if(peli.getIcono()!= null) {
                    byte[] encoded = Base64.getEncoder().encode(peli.getIcono());
                    cadenaIcono = new String(encoded);
                }
                
                String cadenaPoster = "";
                if(peli.getPoster()!= null) {
                    byte[] encoded = Base64.getEncoder().encode(peli.getPoster());
                    cadenaPoster = new String(encoded);
                }
                
                jsonPeli.add("icono",cadenaIcono);
                jsonPeli.add("poster",cadenaPoster);
                
                lista.add(jsonPeli);
            }
        } catch (Exception e) {
            System.out.println("Mensaje Error : Error en la lista de usuarios");
            System.out.println("Mensaje Error : "+e);
        }
        return lista.build();
    }
    
